import React from 'react'

// Styling
import '../styles/css/footer.css'

const Footer = () => {
  return (
    <div className='footerBlack'>
        <div className='logofooter'>Footer</div>
        <div className='centerfooter'> Center content</div>
        <div className='contactfooter'>Contact us</div>

    </div>
    
  )
}

export default Footer
